import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './Dashboard.css';

const Dashboard = () => {
  const [requests, setRequests] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchRequests = async () => {
      try {
        // Simulate fetching requests from the backend with a timeout
        const response = await new Promise((resolve) =>
          setTimeout(() => resolve({
            data: [
              {
                id: 1,
                lectureName: 'Advanced React',
                resourcePerson: 'John Doe',
                facultyCoordinator: 'Jane Smith',
                venue: 'Auditorium',
                date: '2024-07-01',
                attendees: 50
              },
              {
                id: 2,
                lectureName: 'Machine Learning Basics',
                resourcePerson: 'Alice Johnson',
                facultyCoordinator: 'Robert Brown',
                venue: 'Room 101',
                date: '2024-07-05',
                attendees: 70
              }
              // Add more dummy data if needed
            ]
          }), 1000)
        );
        setRequests(response.data);
        setLoading(false);
      } catch (error) {
        setError('Failed to fetch requests');
        setLoading(false);
      }
    };

    fetchRequests();
  }, []);

  const handleApprove = async (id) => {
    try {
      // Simulate approving request
      await new Promise((resolve) => setTimeout(resolve, 500));
      console.log(`Approved request ID: ${id}`);
      setRequests((prevRequests) => prevRequests.filter(request => request.id !== id));
    } catch (error) {
      setError('Failed to approve request');
    }
  };

  const handleReject = async (id, reason) => {
    try {
      // Simulate rejecting request
      await new Promise((resolve) => setTimeout(resolve, 500));
      console.log(`Rejected request ID: ${id} with reason: ${reason}`);
      setRequests((prevRequests) => prevRequests.filter(request => request.id !== id));
    } catch (error) {
      setError('Failed to reject request');
    }
  };

  return (
    <div className="dashboard">
      <h2>Dashboard</h2>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <>
          {error && <div className="error">{error}</div>}
          <table className="dashboard-table">
            <thead>
              <tr>
                <th>S.No</th>
                <th>Name of Lecture</th>
                <th>Resource Person</th>
                <th>Faculty Coordinator</th>
                <th>Venue</th>
                <th>Date</th>
                <th>Attendees</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {requests.map((request, index) => (
                <tr key={request.id}>
                  <td>{index + 1}</td>
                  <td>{request.lectureName}</td>
                  <td>{request.resourcePerson}</td>
                  <td>{request.facultyCoordinator}</td>
                  <td>{request.venue}</td>
                  <td>{request.date}</td>
                  <td>{request.attendees}</td>
                  <td>
                    <button className="btn approve-btn" onClick={() => handleApprove(request.id)}>Approve</button>
                    <button className="btn reject-btn" onClick={() => handleReject(request.id, 'Reason for rejection')}>Reject</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </>
      )}
    </div>
  );
};

export default Dashboard;
